DELIMITER $$
CREATE TRIGGER `update_statistic` AFTER INSERT ON `orders` FOR EACH ROW BEGIN
  DECLARE fieldId INT;
  DECLARE currentMonth DATE;
  
  -- Ambil field_id dan tanggal dari pesanan yang baru saja dimasukkan
  SELECT NEW.field_id, NEW.tanggal_sewa INTO fieldId, currentMonth;
  
  -- Perbarui statistik berdasarkan field_id dan bulan yang sesuai
  UPDATE statistic
  SET total_dipinjam = total_dipinjam + 1
  WHERE field_dipinjam = fieldId;
END
$$
DELIMITER ;

